import React from "react";
import Calculator from "../images/calc.png";

const work = () => {
  return (
    <div className="flex flex-col">
      <div className="flex justify-center md:justify-start ">
        <h1 className="text-4xl py-8 text-white font-bold">MY PROJECTS</h1>
      </div>
      <div className="flex flex-col justify-center items-center md:justify-start md:items-start">
        //image
        <div>
          <img className="w-72 md:w-96 md:p-11" src={Calculator} alt="" />
        </div>
      </div>
      //description
        <div className="bg-white w-72 md:h-72  ">
        <p>
          Lorem ipsum dolor sit, amet consectetur adipisicing elit. Blanditiis
          sed voluptatibus fugiat quisquam architecto officiis minima dolore eum
          maiores velit beatae aperiam fugit tempore delectus, dolorum
          exercitationem nulla nisi corrupti!
        </p>
      </div>
    </div>
  );
};

export default work;
